import React from 'react';
import { Container } from 'react-bootstrap';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';

const NavHeader = () => {
    return (
        <>
            <Container fluid className='nav-color'>
                <Navbar fixed='top' expand="lg" className="bg-body-tertiary">
                    <Container>
                        <Navbar.Brand href="#home" className='nav-text'>TeamUP</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="ms-auto nav-text">
                                <NavDropdown title={<span className='nav-text'>Menu<span className="dropdown-circle"><span className="hamburger-lines"></span></span></span>} id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1" className='nav-text'>Action</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2" className='nav-text'>
                                        Another action
                                    </NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.3" className='nav-text'>Something</NavDropdown.Item>
                                    <NavDropdown.Divider />
                                    <NavDropdown.Item href="#action/3.4" className='nav-text'>Separated link</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </Container>
        </>
    );
};

export default NavHeader;
